import React from 'react';
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import './Navbar.css';

function navbar() {
    return (
      <div className="container nav__wrapper">
        {/* <div classname="row">
          <div className="col-1"></div>
          <div className="col-10"> */}
        <Navbar collapseOnSelect expand="lg" bg="transparent" variant="dark">
          <Navbar.Brand href="#home">
            <img src="/images/Logo.png" alt="logo" />
                    <Navbar.Brand className="brand__name" href="#home" >Liberty Finance</Navbar.Brand>
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav>
              <Nav.Link href="#deets">Dash Board</Nav.Link>
              {/* <Nav.Link href="#deets">Pool</Nav.Link> */}
              <NavDropdown title="Pool" id="collasible-nav-dropdown">
                <NavDropdown.Item href="#pool1">Pool 1</NavDropdown.Item>
                <NavDropdown.Item href="#pool2">Pool 2</NavDropdown.Item>
                <NavDropdown.Item href="#pool3">Pool 3</NavDropdown.Item>
                {/* <NavDropdown.Divider /> */}
                <NavDropdown.Item href="#pool4">Pool 4</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="#deets">Board Room</Nav.Link>
              <Nav.Link href="#deets">Governance</Nav.Link>
              {/* <Nav.Link eventKey={2} href="#memes">
              Dank memes
            </Nav.Link> */}
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        {/* </div>
          <div className="col-1"></div>
        </div> */}
      </div>
    );
};
export default navbar;
